import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes"



function App() {
  return (
    <div>
      <Header />
    {notes.map((newNote)=>{
  (

  <Note 
      key={newNote.id}
     heading={newNote.title}
     description={newNote.content}
     />
  )
})}
      <Footer />
    </div>
  );
}

export default App;
